ins5='insert into T128561 (question,answer) values(%s,%s) '
vals5 = [("Two positively charged particles X and Y are initially far away from each other and at rest. X begins to move towards Y with some initial velocity. The total momentum and energy of the system are p and E : \n(A) If Y is fixed, both p and E are conserved \n(B) If Y is fixed, E is conserved, but not p \n(C) If both are free to move, p is conserved but not E \n(D) If both are free, E is conserved, but not p", "B"),("Two infinite linear charges are placed parallel to each other at a distance 0.1 m from each other. If the linear charge density on each is 5×10^-6 C/m, then the force acting on a unit length of each linear charge will be : \n(A) 2.5 N/m \n(B) 3.25 N/m \n(C) 4.5 N/m \n(D) 7.5 N/m", "C"),("Two point charges + q and –q are held fixed at (–d, 0) and (d, 0) respectively of a x–y co–ordinate system. Then which of the following statement is incorrect : \n(A) The electric field E at all points on the x–axis has the same direction \n(B) No work has to be done in bringing a test charge from infinity to the origin \n(C) Electric field at all point on y–axis is parallel to x–axis \n(D) The dipole moment is 2 qd along the –ve x–axis", "A"),("An uncharged capacitor of capacitance 100 µF is connected to a battery of emf 20V at t = 0 through a resistance 10 ohm, then time at which the rate of energy stored in the capacitor is maximum : \n(A) (4 in 2) ms \n(B) (2 in 2) ms \n(C) (In 2) ms \n(D) (3 In 2) ms", "C"),("A battery of internal resistance 2 ohms is connected to a variable resistor whose value can vary from 4 ohm to 10 ohm. The resistance is initially set at 4 ohms. If the resistance is now increased then \n(A) power consumed by it will decrease \n(B) power consumed by it will increase \n(C) power consumed by it may increase or may decrease \n(D) power consumed will first increase then decrease", "A"),("A constant voltage is applied between the two ends of a uniform metallic wire. Some heat is developed in it. The heat developed is doubled if \n(A) both the length and the radius of the wire are halved \n(B) both the length and the radius of the wire are doubled \n(C) the radius of the wire is doubled \n(D) the length of the wire is doubled", "B"),("Photoelectric effect is the phenomenon in which \n(A) Photons come out of a metal when it is hit by a beam of electrons \n(B) Photons come out of the nucleus of an atom under the action of an electric field \n(C) Electrons come out of metal with a constant velocity depending on frequency and intensity of incident light \n(D) Electrons come out of a metal with different velocity not greater than a certain value which depends only on the frequency of the incident light wave and not on its intensity.", "D"),("When an electro–magnetic radiation is incident on the surface of metal, maximum kinetic energy of photoelectron depends on \n(A) Frequency of radiation \n(B) Intensity of radiation \n(C) Both the frequency and intensity \n(D) Polarization of radiation", "A"),("Which one of the following is true in photoelectric emission \n(A) Photoelectric current is directly proportional to the amplitude of light of a given frequency \n(B) Photoelectric current is directly proportional to the intensity of light of a given frequency above threshold value \n(C) Above the threshold frequency, the maximum K.E. of photoelectrons is inversely proportional to the frequency of incident light \n(D) The threshold frequency depends upon the wavelength of incident light", "B"),("The distance of an object from a spherical mirror is equal to the focal length of the mirror. Then the image: \n(A) must be at infinity \n(B) may be at infinity \n(C) may be at the focus \n(D) none", "B"),("A linear object of length 10 cm lies horizontally along the axis of a concave mirror of focal length 15 cm with its nearer end lying at a distance of 18 cm from the mirror. The size of the image will be \n(A) 27.7 cm \n(B) 32.3 cm \n(C) 55.4 cm \n(D) 57.7 cm", "D"),("An object is immersed in a fluid. In order that the object becomes invisible, it should : \n(A) behave as a perfect reflection \n(B) absorb all light falling on it \n(C) have refractive index one \n(D) have refractive index exactly matching with that of the surrounding fluid", "D"),("For the sustained interference of light, the necessary condition is that the two sources should : \n(A) have constant phase difference \n(B) be narrow \n(C) be close to each other \n(D) of same amplitude", "A"),("Two monochromatic and coherent point sources of light are placed at a certain distance from each other in the horizontal plane. The locus of all those points in the horizontal plane which have constructive interference will be \n(A) A hyperbola \n(B) Family of hyperbolas \n(C) Family of straight lines \n(D) Family of parabolas", "B"),("When light is refracted into a denser medium \n(A) Its wavelength and frequency both increase. \n(B) Its wavelength increases but frequency remains unchanged. \n(C) Its wavelength decreases but frequency remains unchanged. \n(D) its wavelength and frequency both decrease.", "C")]
