ins9='insert into T128565 (question,answer) values(%s,%s) '
vals9 = [("In Young's double slit experiment, the separation between the slits is halved and the distance between the slits and the screen is doubled. The fringe width is: \n(A) unchanged \n(B) halved \n(C) doubled \n(D) quadrupled", "D"), ("In Young's experiment, one slit is covered with a blue filter and the other slit with a yellow filter. Then the interference pattern: \n(A) will be blue \n(B) will be yellow \n(C) will be green \n(D) will not be formed", "D"), ("Which of the following statements is wrong? \n(A) De-Broglie waves are probability waves and there is no physical existence of these. \n(B) De-Broglie wavelength of a moving particle is inversely proportional to its momentum. \n(C) Wave nature is associated with atomic particles only. \n(D) In general, wave nature of matter is not observed.", "C"), ("The stopping potential necessary to reduce the photoelectric current to zero \n(A) is directly proportional to wavelength of incident light. \n(B) uniformly increases with the wavelength of incident light. \n(C) directly proportional to frequency of incident light. \n(D) uniformly increases with the frequency of incident light", "D"), ("A storage battery is connected to a charger for charging with a voltage of 12.5 volts. The internal resistance of the storage battery is 1Ω. When the charging current is 0.5 A, the emf of the storage battery is \n(A) 13 volts \n(B) 12.5 volts \n(C) 12 volts \n(D) 11.5 volts", "C"), ("A battery of internal resistance 2Ω is connected to a variable resistor whose value can vary from 4Ω to 10Ω. The resistance is initially set at 4Ω. If the resistance is now increased then \n(A) power consumed by it will decrease \n(B) power consumed by it will increase \n(C) power consumed by it may increase or may decrease \n(D) power consumed will first increase then decrease", "A"), ("If the electric potential of the inner shell is 10 volts & that of the outer shell is 5 volts, then the potential at the centre will be: (the shells are uniformly charged) \n(A) 10 volt \n(B) 5 volt \n(C) 15 volt \n(D) 0", "A"), ("A hollow metal sphere of radius 5 cm is charged such that the potential on its surface is 10V. The potential at the distance 3 cm from the centre of the sphere is: \n(A) zero \n(B) 10 V \n(C) same as at a point 5 cm away from the surface \n(D) same as at a point 25 cm away from the surface", "B"), ("Two equal negative charges –q are fixed at point (0, –a) and (0, a) on y–axis. A positive charge Q is released from rest at the point (2a, 0) on the x-axis. The charge Q will: \n(A) execute simple harmonic motion about the origin \n(B) move to the origin and remain at rest \n(C) move to infinity \n(D) execute oscillatory but not simple harmonic motion", "D"), ("Optic axis of a thin equiconvex lens is the x–axis. The coordinates of a point object and its image are (–40 cm, 1 cm) and (50 cm, –2 cm) respectively. Lens is located at \n(A) x = + 20 cm \n(B) x = – 30 cm \n(C) x = –10 cm \n(D) origin", "C"), ("A particle is dropped from the height of 20m on horizontal ground. There is wind blowing due to which horizontal acceleration of the particle becomes 6 m/s². Find the horizontal displacement of the particle till it reaches ground. \n(A) 6 m \n(B) 10 m \n(C) 12 m \n(D) 24 m", "C"), ("A person drops a stone from a building of height 20 m. At the same instant the front end of a truck passes below the building moving with constant acceleration of 1 m/s² and velocity of 2 m/s at that instant. Length of the truck if the stone just misses to hit its rear part is: \n(A) 6 m \n(B) 4 m \n(C) 5 m \n(D) 2 m", "A"), ("A solid sphere (mass 2M) and a thin hollow spherical shell (mass M) both of the same size, roll down an inclined plane, then \n(A) Solid sphere will reach the bottom first \n(B) Hollow spherical shell will reach the bottom first \n(C) Both will reach at the same time \n(D) None of these", "A"), ("Balls are thrown vertically upward in such a way that the next ball is thrown when the previous one is at the maximum height. If the maximum height is 5m, the number of balls thrown per minute will be: \n(A) 40 \n(B) 50 \n(C) 60 \n(D) 120", "C"), ("A 2m long rod of radius 1 cm which is fixed from one end is given a twist of 0.8 radians. The shear strain developed will be: \n(A) 0.002 \n(B) 0.004 \n(C) 0.008 \n(D) 0.016", "B"), ("Two soap bubbles each of radius r are touching each other. The radius of curvature of the common surface will be: \n(A) infinite \n(B) 2r \n(C) r \n(D) r/2", "A"), ("Displacement of a particle is x = 3 sin 2t + 4cos 2t, the amplitude and the maximum velocity will be: \n(A) 5, 10 \n(B) 3, 2 \n(C) 4, 2 \n(D) 3, 8", "A"), ("A copper ball of radius r travels with a uniform speed v in a viscous fluid. If the ball is changed with another ball of radius 2r, then new uniform speed will be: \n(A) v \n(B) 2v \n(C) 4v \n(D) 8v", "C"), ("Two tuning forks having frequency 256 Hz (A) and 262 Hz (B) tuning fork A produces some beats per second with an unknown tuning fork, same unknown tuning fork produces double beats per second from B tuning fork, then the frequency of unknown tuning fork is: \n(A) 262 \n(B) 260 \n(C) 250 \n(D) 300", "C"), ("A sound absorber attenuates the sound level by 20 dB. The intensity decreases by a factor of: \n(A) 1000 \n(B) 10000 \n(C) 10 \n(D) 100", "D")]
